      dispatch(fetchDeviceEvents());
    },
    [dispatch]
  );

  // TODO: Improve this view

  const events: DeviceEvent[] = useSelector(getAllDeviceEvents);
  const eventDetails: DeviceEvent | undefined = events?.find((event) => {
    return event?.id?.toString() === eventId;
  });

